sys_variable_value.value:
(function execute(inputs, outputs) {

if( inputs.msg != '' ) {
	sn_connect.Conversation.get(inputs.docid, inputs.table)
		.sendMessage({
			body: inputs.msg,
			system: false,
			internal: true
		});
}	

})(inputs, outputs);

